import React from 'react'
import { FaLinkedin } from "react-icons/fa";
import { FaInstagramSquare } from "react-icons/fa";
import { FaFacebook } from "react-icons/fa";
import { FaTwitter } from "react-icons/fa";
const navbar = () => {
    return (
        <div>
            <div className='bg-[#202434] text-white flex'>
                <div className='flex justify-end p-4 gap-5  border-white border w-[15%]'>

<a>
                    <FaLinkedin className='hover:text-blue-500 cursor-pointer' />
                    </a>
                    <FaInstagramSquare className='hover:text-blue-500 cursor-pointer'/>
                    <FaFacebook className='hover:text-blue-500 cursor-pointer'/>
                    <FaTwitter className='hover:text-blue-500 cursor-pointer'/>

                </div>
                <div>
                    <h2 className='w-[100%] p-4 text-[12px]'>Sat Dec 16 2023 2:51 PM </h2>
                </div>



            </div>
        </div>
    )
}

export default navbar
